<!doctype html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />

  <meta name="robots" content="noindex, nofollow" />
  <meta name="googlebot" content="noindex, nofollow" />
  <meta name="referrer" content="no-referrer" />

  <title>Portfolio</title>

  <style>
    :root{
      --bg:#07080b;
      --bg2:#0a0c11;

      --fg:rgba(255,255,255,.92);
      --muted:rgba(255,255,255,.66);
      --faint:rgba(255,255,255,.44);

      --line:rgba(255,255,255,.10);
      --line2:rgba(255,255,255,.16);

      --panel:rgba(255,255,255,.035);

      --mono: ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, "Liberation Mono", "Courier New", monospace;
      --sans: ui-sans-serif, system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial;

      --r:16px;
      --shadow:0 10px 30px rgba(0,0,0,.35);
      --shadow2:0 10px 24px rgba(0,0,0,.28);
      --focusRing: 0 0 0 3px rgba(255,255,255,.10);

      --accentRed: rgba(255,80,80,.86);
      --accentRedFaint: rgba(255,80,80,.22);
    }

    html,body{height:100%;}
    body{
      margin:0;
      font-family:var(--sans);
      color:var(--fg);
      background:
        radial-gradient(1200px 800px at 18% -10%, rgba(255,255,255,.06), transparent 60%),
        radial-gradient(900px 700px at 78% 0%, rgba(255,255,255,.04), transparent 60%),
        linear-gradient(180deg, var(--bg), var(--bg2) 70%);
      letter-spacing:.1px;
    }

    a{color:var(--fg); text-decoration:underline; text-decoration-color:rgba(255,255,255,.28);}
    a:hover{text-decoration-color:rgba(255,255,255,.55);}

    .wrap{max-width:1240px; margin:0 auto; padding:18px 18px 72px;}

    .top{
      display:flex;
      justify-content:space-between;
      align-items:flex-start;
      gap:16px;
      padding:10px 6px 6px;
    }
    .id strong{font-weight:880; letter-spacing:-0.2px;}
    .id .line{color:var(--muted); font-size:13.8px; line-height:1.55;}
    .meta{color:var(--muted); font-size:12.6px; text-align:right; line-height:1.5;}
    .pill{
      display:inline-flex; gap:8px; align-items:center;
      border:1px solid var(--line);
      background:rgba(255,255,255,.03);
      padding:7px 10px;
      border-radius:999px;
      font-size:12px;
      color:var(--muted);
    }
    .dot{
      width:8px;height:8px;border-radius:999px;
      background:rgba(255,255,255,.35);
      box-shadow:0 0 0 3px rgba(255,255,255,.06);
    }

    .hero{
      padding:8px 6px 12px;
      display:flex;
      align-items:flex-end;
      justify-content:space-between;
      gap:16px;
      flex-wrap:wrap;
    }
    .hero h1{
      margin:0;
      font-size:24px;
      font-weight:920;
      letter-spacing:-0.35px;
    }
    .hero p{
      margin:6px 0 0;
      color:var(--muted);
      font-size:14.1px;
      line-height:1.75;
      max-width:92ch;
    }

    .btnRow{display:flex; gap:10px; flex-wrap:wrap; align-items:center;}
    .btn{
      font-family:var(--mono);
      font-size:12px;
      color:var(--muted);
      border:1px solid var(--line);
      background:rgba(255,255,255,.03);
      padding:7px 10px;
      border-radius:12px;
      cursor:pointer;
      user-select:none;
      text-decoration:none;
      display:inline-flex;
      align-items:center;
      gap:8px;
      white-space:nowrap;
    }
    .btn:hover{border-color:var(--line2); color:var(--fg);}
    .btn:focus{outline:none; box-shadow: var(--focusRing);}
    .btnPrimary{
      border-color: rgba(255,255,255,.18);
      background: rgba(255,255,255,.08);
      color: var(--fg);
    }
    .btnDanger{
      border-color: rgba(255,80,80,.30);
      background: rgba(255,80,80,.10);
      color: rgba(255,255,255,.90);
    }
    .btnDanger:hover{
      border-color: rgba(255,80,80,.45);
      background: rgba(255,80,80,.14);
    }

    .label{
      font-size:12px;
      font-weight:880;
      letter-spacing:.09em;
      text-transform:uppercase;
      color:var(--fg);
    }

    /* Sticky timeline */
    .stickyBar{
      position: sticky;
      top: 0;
      z-index: 20;
      margin-top: 6px;
      backdrop-filter: blur(10px);
      background: rgba(7,8,11,.70);
      border-bottom: 1px solid rgba(255,255,255,.08);
      padding: 10px 6px 10px;
    }
    .stickyInner{
      border:1px solid var(--line);
      background: rgba(255,255,255,.03);
      border-radius: var(--r);
      padding: 10px;
      box-shadow: var(--shadow2);
    }
    .barTop{
      display:flex;
      align-items:baseline;
      justify-content:space-between;
      gap:10px;
      padding: 0 4px 8px;
    }
    .barHint{font-family:var(--mono); font-size:12px; color:var(--faint);}
    .timelineViewport{
      border:1px solid var(--line);
      background: rgba(0,0,0,.22);
      border-radius: var(--r);
      overflow:hidden;
    }
    svg{display:block; width:100%; height:auto;}
    .barBottom{
      display:flex;
      align-items:center;
      justify-content:space-between;
      gap:10px;
      padding: 8px 4px 0;
      flex-wrap:wrap;
    }
    .preview{
      color:var(--muted);
      font-size:13.2px;
      line-height:1.6;
      max-width: 92ch;
      white-space:pre-line;
    }

    /* Story + rail */
    .storyWrap{
      position:relative;
      margin-top: 12px;
      padding-left: 22px;
    }
    .rail{
      position:absolute;
      left: 10px;
      top: 0;
      bottom: 0;
      width: 2px;
      background: rgba(255,255,255,.08);
      border-radius: 999px;
    }
    .railFill{
      position:absolute;
      left: 10px;
      top: 0;
      width: 2px;
      height: 0px;
      background: var(--accentRed);
      box-shadow: 0 0 0 3px var(--accentRedFaint);
      border-radius: 999px;
      transition: height .10s linear;
    }

    .storyHeader{
      display:flex;
      justify-content:space-between;
      align-items:baseline;
      gap:10px;
      margin: 8px 0 10px;
      padding: 0 6px;
    }
    .storyHeader .sub{
      font-family:var(--mono);
      font-size:12px;
      color:var(--faint);
    }
.section{
  position: relative;
  border-left: 3px solid transparent;
}

.section::before{
  content:"";
  position:absolute;
  left:-3px;
  top:0;
  bottom:0;
  width:3px;
  background: var(--laneColor, transparent);
  opacity:.75;
  border-radius:3px;
}

.section.active::before{
  opacity:1;
}
    .section{
      scroll-margin-top: 190px;
      border:1px solid var(--line);
      background: rgba(255,255,255,.02);
      border-radius: var(--r);
      padding: 14px;
      margin: 0 6px 12px;
      transition: border-color .18s ease, background .18s ease, transform .18s ease;
    }
.section{ cursor:pointer; }
.section details{ cursor:default; } /* keep toggles feeling normal */
    .section.active{
      border-color: rgba(255,255,255,.22);
      background: rgba(255,255,255,.03);
      transform: translateY(-1px);
    }

    .secTop{
      display:flex;
      justify-content:space-between;
      gap:12px;
      align-items:flex-start;
      flex-wrap:wrap;
    }
    .secTitle{
      margin:0;
      font-size:16px;
      font-weight:920;
      letter-spacing:-0.2px;
    }
    .secMeta{
      font-family:var(--mono);
      font-size:12px;
      color:var(--muted);
      white-space:nowrap;
      margin-top: 2px;
    }
    .badgeRow{display:flex; flex-wrap:wrap; gap:8px; margin-top:10px;}
    .badge{
      border:1px solid rgba(255,255,255,.14);
      background: rgba(255,255,255,.04);
      border-radius:999px;
      padding:6px 10px;
      font-size:12px;
      color: rgba(255,255,255,.78);
    }
    .secPreview{
      margin-top:10px;
      color: var(--muted);
      font-size: 13.8px;
      line-height: 1.75;
      max-width: 96ch;
    }

    details.block{
      border-top:1px solid var(--line);
      padding-top:10px;
      margin-top:10px;
    }
    details.block summary{
      cursor:pointer;
      list-style:none;
      display:flex;
      align-items:center;
      justify-content:space-between;
      gap:12px;
      user-select:none;
    }
    details.block summary::-webkit-details-marker{display:none;}
    .blockTitle{
      font-size:11.5px;
      font-weight:880;
      letter-spacing:.09em;
      text-transform:uppercase;
      color: var(--fg);
      margin:0;
    }
    .chev{
      font-family: var(--mono);
      color: var(--faint);
      font-size: 12px;
    }
    .blockBody{
      margin-top:8px;
      animation: fadeIn .16s ease;
    }
    @keyframes fadeIn{
      from{opacity:.0; transform: translateY(-2px);}
      to{opacity:1; transform: translateY(0);}
    }
    .blockBody p{
      margin:6px 0;
      color:var(--muted);
      font-size:13.8px;
      line-height:1.75;
      max-width: 96ch;
    }
    .blockBody ul{
      margin:8px 0 0 18px;
      padding:0;
      color:var(--muted);
      font-size:13.8px;
      line-height:1.75;
      max-width: 96ch;
    }
    .blockBody li{margin:6px 0;}

    .chips{display:flex; flex-wrap:wrap; gap:8px; margin-top:8px;}
    .chip{
      border:1px solid var(--line);
      background:rgba(255,255,255,.02);
      border-radius:999px;
      padding:6px 10px;
      font-size:12px;
      color:var(--muted);
    }

    .footer{
      margin-top:14px;
      padding: 0 6px;
      color:var(--faint);
      font-size:12.5px;
    }

    /* Gate */
    .gate{min-height:100%; display:flex; align-items:center; justify-content:center; padding:40px 18px;}
    .gatebox{
      max-width:860px; width:100%;
      border:1px solid var(--line);
      background:rgba(255,255,255,.03);
      border-radius:18px;
      box-shadow:var(--shadow);
      padding:18px;
    }
    .gatebox h1{margin:0 0 8px; font-size:18px; font-weight:920;}
    .gatebox p{margin:8px 0; color:var(--muted); font-size:14px; line-height:1.7;}
    .spinnerRow{display:flex; gap:12px; align-items:center; margin-top:10px;}
    .spinner{
      width:18px; height:18px; border-radius:999px;
      border:2px solid rgba(255,255,255,.18);
      border-top-color: rgba(255,255,255,.70);
      animation: spin 0.9s linear infinite;
    }
    @keyframes spin{to{transform:rotate(360deg);}}
    .status{font-family:var(--mono); font-size:12.5px; color:var(--muted); line-height:1.5;}
    .errorBox{
      margin-top:10px;
      border:1px solid rgba(255,255,255,.18);
      background:rgba(255,255,255,.03);
      border-radius:14px;
      padding:12px;
      font-family:var(--mono);
      font-size:12.5px;
      color:var(--muted);
      line-height:1.55;
      overflow:auto;
      max-height:420px;
      white-space:pre-wrap;
    }
  </style>
</head>

<body>
  <main id="app"></main>
